    element.classList.add('hide');
}      

for (let f = 0; f < textarea.length; f++) {
    const element = textarea[f];
    element.style.height('150px');
    console.log(element + "k");
    
}

        monpopup.style.zIndex="100";
        let idDemande = p.id;
        let popUp = document.getElementsByClassName('lArticlePop');
        for (let index = 0; index < popUp.length; index++) {
            const element = popUp[index];
            let idElement = element.id;
            if (idElement == idDemande) {
                element.classList.remove('hide');
            } else {

            }
        }
    }

    function closePopUp(p){
        monpopup.style.zIndex="0";
        articlepopup.classList.remove('hide');
        let testId = p.getAttribute('test');
        let video = document.getElementsByTagName('video');
        for (let u = 0; u < video.length; u++) {
            const elementVID = video[u];
            
            elementVID.pause();
            elementVID.currentTime = 0;
        }
        let popUp = document.getElementsByClassName('lArticlePop');
        for (let index = 0; index < popUp.length; index++) {
            const element = popUp[index];
            let idElement = element.id;
            if (idElement == testId) {
                element.classList.add('hide');
            } else {

            }
    }
    }




